import React, { Component } from 'react';


class NotesList extends Component {

  render() {
    return (
      <main>
        <h2> Your Notes:
        {this.props.title}
        </h2>
        <h2> Your Notes:
        {this.props.content}
        </h2>
      </main>
    );
  }
}

export default NotesList;
